import React from 'react';
const Employees = React.lazy(() => import('./views/Base/Employees'));
const Projects = React.lazy(() => import('./views/Base/Projects'));
const Dashboard = React.lazy(() => import('./views/Dashboard'));

const routes = [
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboard', name: 'Dashboard', component: Dashboard },
  { path: '/add_details/employee', name: 'Forms', component: Employees },
  {path: '/add_details/project', name: 'Project', component: Projects}
];

export default routes;
